@DESCRIPTION:
Manage Performance Reporting business activity provide the planning and reporting needed to achieve business outcomes.

Performance reporting involves planning (including the production of the priorities and strategies overview and the supplemental information) for any legislative review. It includes reporting on the plans, including annual reports.

Performance reporting is designed to help:
- clarify organizational goals and directions;
- communicate the priorities of the organization;
- monitor progress and make continuous improvement;
- support budgeting and resource allocation decisions; and
- provide information to legislators, the public, media and others about the work of the organization.

Manage Performance Reporting helps to promote a “continuous improvement” feedback loop where reports on activities and performance provide important information to allow for the best possible decision-making in the next planning cycle.

"The responsibilities of the Manage Field Workforce processes is to manage the lifecycle of  work assignments or work orders  carried out by the workforce.  This will include managing the workforce staff (directly or indirectly) employed by, or operating as part of, the enterprise (i.e. technicians, clerks, managers, etc.) that are assigned to, and perform the work specified. The staff directly managed by these processes include all employees, contractors and who are paid by the enterprise.  The staff indirectly managed by these processes includes all employees, consultants and contractors paid by third parties who have commercial arrangements with the enterprise. In the cases where the third parties own and manage the service and/or resource infrastructure the Manage Field Workforce processes are responsible for requesting activities to be performed rather than directly assigning specific staff. The Manage Workforce processes also enable reporting and monitoring of assigned activities. Responsibilities of these processes include, but are not limited to:
- Establishing and managing work assignment queues through which requests for work activities are received from eTOM processes;
- Establishing and managing staff lists, containing details about assignable staff such as location, skills, availability for assignment etc.;
- Establishing, managing and distributing individuals work assignments to staff outlining the daily, or other time breadth, work assignments;
- Establishing and managing fast-track and jeopardy re-assignment capabilities to allow for modification of work assignments as required to meet jeopardy or other high priority conditions;
- Managing appointment schedules, including viewing and scheduling of appointments;
- Managing work orders, including issuance and closure;
- Forecasting assignable staffing requirements on a daily, weekly and longer period basis, based on historic work volume records, and forecast activity volumes;
- Determining work activity time estimates for all known work activities, based on actual historic results or on forward estimates, to be used as a parameter for scheduling work rosters;
- Establishing and managing recall capabilities to allow for out-of-hours staff recall in the event of unforeseen circumstances;
- Managing the registration and access control processes that enable processes to create, modify, update, delete and/or download scheduling and work assignment data to and from the workforce management system(s);
- Establishing and managing information transfer between the enterprise workforce management system(s) and those of external third parties (when the infrastructure is owned and operated by third parties);
- Ensuring MFW system(s) accurately captures and records all assignment and  work scheduling details, through use of automated or manual audits;
- Tracking and monitoring of the usage of, and access to, the MFW system(s) and associated costs of the Manage Field Workforce processes, and reporting on the findings
- Identifying any technical driven shortcomings of the workforce management system(s), and providing input to Resource Development & Management processes to rectify these issues.- "

The Business Partner Performance Management processes track, monitor and report on performance to ensure that the interactions are in accordance with the agreed commercial arrangements between the service provider and another Business Partner. 

Parties are engaged by the service provider in performance related activities when:
• higher level expertise and/or higher level support is required to resolve the product performance, service performance or resource performance issues;
• the service provider has outsourced specific activities to another Business Partner which are needed as part of performance improvement activity (i.e. outsourced field maintenance);
• the specific product and/or service are purchased from an external Business Partner (as in an interconnect service); or
• the specific product and/or service, or specific product and/or service component, are owned and delivered by an external Business Partner.

