The purpose of the Party Inventory Management processes are twofold - establish, manage and administer the enterprise's Party inventory, as embodied in the Party Inventory Database, and monitor and report on the usage and access to the Party inventory, and the quality of the data maintained in it.

The supplier/partner inventory maintains records of all commercial arrangements with parties, and any modifications to them. It also records all details of contacts with parties as well as commercial information, including details of Party products and services, required to support Party Requisition Management and other processes.

The Party inventory is also responsible for maintaining the association between product instances, service instances, resource instances and Party product instances, created as a result of the Party Requisition Management processes.

Responsibilities of these processes include, but are not limited to:
